import React from 'react';

const ButtonSegment = () => {
    return (
        <div className="buttonWrapper">
            <div className="center">
                <button>Previous</button>
                <button>Next</button>
                <button>Random</button>
            </div>
        </div>
    );
};

export default ButtonSegment;
